import React from 'react'
import { Head } from 'next/document'







export default function PrintRecipt() {
    return (

        <div>
            <Head>
                <style jsx>
                    {
                        `

.print-action-bar {
    position: fixed;
    width: 100%;
    background: #fff;
    bottom: 0;
    height: 60px;
    padding: 10px;
    box-shadow: 0px 8px 15px 0px #000;
    text-align: center;
    z-index: 100000;
    }
    .print-icon,.download-icon {
    display: inline-block;
    margin: 0 10px;
    width: 200px;
    background: #0070C0;
    position: relative;
    line-height: 40px;
    color: #fff;
    padding: 10px 30px;
    font-size: 21px;
    text-transform: uppercase;
    font-weight: bold;
    }
    .print-icon:hover,.download-icon:hover{
    cursor:pointer;
    }

    .ads-container{margin:10px auto;text-align:center;}
    .print-icon svg,
    .download-icon svg {
    height: 40px;
    width: 40px;
    float: left;
    margin-right: 15px;
    }


        html, body, div, span, applet, object, iframe,
        h1, h2, h3, h4, h5, h6, p, blockquote, pre,
        a, abbr, acronym, address, big, cite, code,
        del, dfn, em, img, ins, kbd, q, s, samp,
        small, strike, strong, sub, sup, tt, var,
        b, u, i, center,
        dl, dt, dd, ol, ul, li,
        fieldset, form, label, legend,
        table, caption, tbody, tfoot, thead, tr, th, td,
        article, aside, canvas, details, embed, 
        figure, figcaption, footer, header, hgroup, 
        menu, nav, output, ruby, section, summary,
        time, mark, audio, video {
            margin: 0;
            padding: 0;
            border: 0;
            font-size: 12px;
            font: inherit;
            vertical-align: baseline;
        }
        article, aside, details, figcaption, figure, 
        footer, header, hgroup, menu, nav, section {
            display: block;
        }
        body {
            line-height: 1;
            word-break: break-word;
            letter-spacing:0 !important;
        }
        ol, ul {
            list-style: none;
        }
        blockquote, q {
            quotes: none;
        }
        blockquote:before, blockquote:after, q:before, q:after {
            content: '';
            content: none;
        }
        table {
            border-collapse: collapse;
            border-spacing: 0;
        }
        body {
            font-family:'Roboto';
        }
        b {
            font-weight:bold;
        }
        table {
            vertical-align: top;
            width: 100%;
            border-collapse: collapse;
        }
        tr {
            vertical-align: top;
        }
        td {
            vertical-align: middle;
            margin:0;
            padding:0;
        }
        .txt-tranport-sr-no{color:#fff;font-size:0;}
        .txt-bold {
            font-weight:bold;
        }
        .txt-center {
            text-align:center;
        }
        .txt-left {
            text-align:left;
        }
        .txt-right {
            text-align:right;
        }
        .txt-bg {
            background-color:#E8F3FD;
        }
        .border-bottom-cell {
            border-bottom:1px solid #0070C0; 
        }
        .invoice .main-border {
            border:1px solid #0070C0;
            padding: 0;
            margin:0;
        }
        .invoice .header-row {
            vertical-align:middle;
            border-bottom:1px solid #0070C0;
        }
        .invoice .header .invoice-title {
            text-align:center;
            font-size:20px;
            color:#0070C0;
            padding:3px 0;
            font-weight:bold;
        }
        .invoice .header .copyname {
            text-align:right;
            padding-right:5px;
            font-size:11px;
            font-weight:bold;
        }
        .invoice .header .gstin {
            padding-left:5px;
        }
        .invoice .header .gstin span {
            font-weight:bold;
            text-align:left;
        }
        .billdetailsthead td {
            background-color:#E8F3FD;
            border:1px solid #0070C0;
            border-collapse:collapse;
            text-align:center;
            font-weight:bold;
            padding:5px 2px;
        }
        .billdetailstbody td {
            padding:2px 2px 0px;
            font-size:11px;
            vertical-align: top;
            line-height:15px;
        }
        .billdetailstbody td.txt-center {
            text-align:center;
        }
        .billdetailstbody td.txt-left {
            text-align:left;
        }
        .billdetailstbody td.txt-right {
            text-align:right;
        }
        .billdetailstbody td.txt-bg {
        }
        .billdetailstbody .last-row td {
        }
        .invoicedataFooter td {
            font-size:10px;
            background-color:#E8F3FD;
            padding:5px 1px 5px 0px;
            border:1px solid #0070C0;
        }
        .valign-top {
            vertical-align: top;
        }
        .valign-mid {
            vertical-align: middle;
        }
        .billdetailstbody td span {
            font-style:italic;
        }
        .billdetailstbody td {
            max-width: 1px;
        }

        .customerexportdata td {
            padding:2px 5px 3px 5px;
            font-size:11px;
            vertical-align: top;
            line-height:13px;
        }
        .customerexportdata td.customerexportdata_item_label {
            font-weight: bold;
        }

        .customerdata td {
            padding:2px 5px 3px 5px;
            font-size:11px;
            vertical-align: top;
            line-height:13px;
        }
                    .invoicedata td {
                padding:3px 5px 6px 5px;
                font-size:11px;
                vertical-align: top;
                line-height:13px;
            }
